pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract FlashLoanSimulator {
    address public owner;

    event LoanTaken(address indexed borrower, address indexed token, uint256 amount);
    event LoanRepaid(address indexed borrower, address indexed token, uint256 amount);

    constructor() {
        owner = msg.sender;
    }

    // Deposit liquidity into the contract to be used for loans
    function deposit(address token, uint256 amount) external {
        require(
            IERC20(token).transferFrom(msg.sender, address(this), amount),
            "Transfer failed"
        );
    }

    // Withdraw liquidity (only owner)
    function withdraw(address token, uint256 amount) external {
        require(msg.sender == owner, "Not owner");
        IERC20(token).transfer(msg.sender, amount);
    }

    // Simulate flash loan
    function flashLoan(address token, uint256 amount, bytes calldata data) external {
        uint256 balanceBefore = IERC20(token).balanceOf(address(this));
        require(balanceBefore >= amount, "Insufficient liquidity");

        // Transfer loan to borrower
        IERC20(token).transfer(msg.sender, amount);
        emit LoanTaken(msg.sender, token, amount);

        // Call borrower contract to use the funds
        IFlashLoanUser(msg.sender).executeOperation(token, amount, data);

        // After operation, check repayment
        uint256 balanceAfter = IERC20(token).balanceOf(address(this));
        require(balanceAfter >= balanceBefore, "Loan not repaid");

        emit LoanRepaid(msg.sender, token, amount);
    }
}

// Interface borrower must implement
interface IFlashLoanUser {
    function executeOperation(address token, uint256 amount, bytes calldata data) external;
}
